import React, { useEffect, useState } from 'react'

const Profile = () => {
  const [details,setdetails] = useState("");
  const handle = async() => {
    var x= localStorage.getItem('reg');
    const res = await fetch('http://localhost:3001/find',{
        method:'POST',
        headers: {
             'Content-Type' : 'application/json'
        },
        body: JSON.stringify({
            x
        })
    })
    const data = await res.json()
    if(data.status === 'ok'){
      setdetails(data.data);
      alert(details);
  }
  else{
      alert(data.message);
  }
  }
  useEffect = () =>{
    handle();
    console.log(details);
  }
  return (
    <div>Profile
    <p>{details}</p>
    </div>
  )
}

export default Profile
